import React from "react";
import PText from "./PText";
import SectionTitle from "./SectionTitle";

export default function AboutSection() {
  return (
    <div>
      <div className="container">
        <div className="aboutSection__left">
          <SectionTitle
            className="section-title"
            subheading="Let me introduce myself"
            heading="About me"
          />
          <PText>
            I am a freelance web developer and designer from Columbia, South
            Carolina. I have been creating websites and web applications for the
            past 3 years. I love finding new ways to create and express myself
            and skillset through code.
          </PText>
          <div className="aboutSection__buttons"></div>
        </div>
      </div>
    </div>
  );
}
